import React from "react";
import WindMill from "./WindMill";
import GameIntroModal from "./GameIntroModal";
import HelperDisplayBar from "./HelperDisplayBar";
function GameContainer({totalWatts,updateWatts,miningPower,dps,shopData}) {


return( 
    <div className="grid-div" id="center-div">

    <h1 className="large-txt">{totalWatts} W</h1>
    {/* <h1 id="dps"> Constant Velocity: {dps} m/s</h1> */}

    <GameIntroModal/>
    <WindMill
      updateWatts= { updateWatts}
      miningPower={miningPower}
      dps={dps}
    />

    <HelperDisplayBar
    shopData={shopData}
    />
  </div>
)
}
export default GameContainer
